import * as $ from 'jquery'; 

function get(url) {                                                          
    const content = (() => {                                                  
        var content = null;                                                   
        $.ajax({                                                              
            'async': false,                                                   
            'url': url,                                                       
            'dataType': "text",                                               
            'success': (data) => {                                            
                content = data;                                               
            }                                                                 
        });                                                                   
        return content;                                                       
    })();                                                                     
    return content;                                                           
}        

export default get;
